    <title> Practice 31 - Cocococombomath</title>

    <script>

        function cocococombomath(num1, num2, num3, num4, num5) {
            var result1 = num1 * num2;

            var result2 = result1 + num3;

            var result3 = result2/num4;

            var result4 = result3 - num5;

            return result4;

        }

    </script>
